# -*- coding: utf-8 -*-
def crear_biblioteca():
    biblioteca = {
            'generos' : [],
            'artistas' : {},
            'discos' : [],
            'canciones' : []
        }     
    
    with open("csv/genre.csv") as fl_generos:
        generos = [ln.replace('\n', '') for ln in fl_generos]
    with open("csv/artist.csv") as fl_artistas:
        artistas = [ln.replace('\n', '') for ln in fl_artistas]
    with open("csv/release_group.csv") as fl_discos:
        discos = [ln.replace('\n', '') for ln in fl_discos]
    with open("csv/tracks.csv") as fl_canciones:
        canciones = [ln.replace('\n', '') for ln in fl_canciones]
        
    for i in range(len(artistas)):
        crear_artista(artistas[i], random.choice(generos), biblioteca)
        for j in range(random.randint(1,6)):
            idx_disco = crear_disco(\
                discos[j],\
                f"{random.randint(1,13)}/{random.randint(1900,2023)}",\
                [],\
                artistas[i],\
                biblioteca)
            for k in range(random.randint(3,13)):
                crear_cancion(\
                    random.choice(canciones),\
                        "%02d:%02d:%02d" % (0, random.randint(13),\
                            random.randint(60)),\
                    idx_disco,\
                    biblioteca)
    
    with open("biblioteca.py", "w") as biblioteca_py:
        biblioteca_py.write("# -*- coding: utf-8 -*-")
        biblioteca_py.write(f"biblioteca = {biblioteca}\n")
    return biblioteca

